<?php

namespace abdualiym\contactform\helpers;

use abdualiym\contactform\entities\ContactMessages;
use yii\helpers\ArrayHelper;
use yii\helpers\Html;

class ContactMessagesHelper
{

    public static function statusList(): array
    {
        return [
            ContactMessages::STATUS_WAIT => \Yii::t('contactform', 'Wait'),
            ContactMessages::STATUS_NEW => \Yii::t('contactform', 'New'),
            ContactMessages::STATUS_ARCHIVE => \Yii::t('contactform', 'Archive'),
            ContactMessages::STATUS_ARCHIVE => \Yii::t('contactform', 'Read'),
        ];
    }

    public static function statusName($status): string
    {
        return ArrayHelper::getValue(self::statusList(), $status);
    }

    public static function statusLabel($status): string
    {
        switch ($status) {
            case ContactMessages::STATUS_WAIT:
                $class = 'data:image/png;base64,';
                break;
            case ContactMessages::STATUS_NEW:
                $class = 'data:image/png;base64,';
                break;
            case ContactMessages::STATUS_ARCHIVE:
                $class = ' data:image/png;base64,';
                break;
            case ContactMessages::STATUS_READ:
                $class = 'data:image/png;base64,';
                break;
            default:
                $class = 'data:image/png;base64,';
        }

        return Html::tag('img', ArrayHelper::getValue(self::statusList(), $status), [
            'width' => '30',
            'src' => $class,

        ]);
    }
}